import React from 'react';
import { HashRouter as Router, Routes, Route } from 'react-router-dom';

// Page Components
import Navbar from './components/Navbar';
import Home from './components/Home';
import S3Contents from './components/S3Contents';
import Predictions from './components/Predictions';
import AthenaQuery from './components/AthenaQuery';
import SendEmail from './components/SendEmail';

// Optional: Global Styles (if using styled-components or CSS Modules)
import './App.css';

function App() {
  return (
    <Router>
      <div className="app-container">
        {/* Top Navigation */}
        <Navbar />

        {/* Page Routing */}
        <main style={{ padding: '1rem' }}>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/s3" element={<S3Contents />} />
            <Route path="/predictions" element={<Predictions />} />
            <Route path="/athena" element={<AthenaQuery />} />
            <Route path="/send-email" element={<SendEmail />} />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
